import React from "react";
import Cube from 'react-3d-cube';

const Cubes = () =>{
    return(
        <>
         <center>
            
           
          
            <div
            style={{
                width: 300,
                height: 300
            }}
            >
            <Cube size={300} >
                <div>front</div>
                <div>right</div>
                <div>back</div>
                <div>left</div>
                <div>top</div>
                <div>bottom</div>
            </Cube>
            </div>
        </center>
        </>
    )
}

export default Cubes;
